import logo from "./logo.svg";
import Navigation from "./components/navigation.jsx";
import ImageLinkForm from "./components/imageLinkForm.jsx";
import Rank from "./components/Rank.jsx";
import Particles from "react-particles-js";
import "tachyons";
console.log(document.clientX);
function App() {
  return (
    <div className="App">
      {/* <Particles
        className="background"
        params={{
          particles: {
            number: {
              value: (window.innerHeight * window.innerWidth) / 10000,
            },
            size: {
              value: 3,
            },
          },
          interactivity: {
            events: {
              onclick: {
                enable: true,
                mode: "repulse",
              },
            },
          },
        }}
      /> */}
      <Particles
        params={{
          fps_limit: 28,
          particles: {
            collisions: {
              enable: false,
            },
            number: {
              value: 200,
              density: {
                enable: false,
              },
            },
            line_linked: {
              enable: true,
              distance: 30,
              opacity: 0.4,
            },
            move: {
              speed: 1,
            },
            opacity: {
              anim: {
                enable: true,
                opacity_min: 0.05,
                speed: 1,
                sync: false,
              },
              value: 0.4,
            },
          },
          polygon: {
            enable: true,
            scale: 2,
            type: "inline",
            move: {
              radius: 10,
            },
            url: "./assets/brain.svg",
            inline: {
              arrangement: "equidistant",
            },
            draw: {
              enable: true,
              stroke: {
                color: "rgba(255, 255, 255, .2)",
              },
            },
          },
          retina_detect: false,
          interactivity: {
            events: {
              onhover: {
                enable: true,
                mode: "bubble",
              },
            },
            modes: {
              bubble: {
                size: 6,
                distance: 40,
              },
            },
          },
        }}
      />
      <Navigation />
      <Rank />
      <ImageLinkForm />
    </div>
  );
}

export default App;
